import React from 'react';
import { Link } from 'react-router-dom';
import "./Inicio.css"; 

const Inicio = () => {
  return (
    <div className="menu-lateral">
      <Link to="/tela1" className="menu-button">Bot達o 1</Link>
      <Link to="/tela2" className="menu-button">Bot達o 2</Link>
      <Link to="/tela3" className="menu-button">Bot達o 3</Link>
      <Link to="/tela4" className="menu-button">Bot達o 4</Link>
    </div>
  );
};

export default Inicio;
